<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Dashboard Eleições CONFEA/CREA</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Inter', 'Segoe UI', -apple-system, BlinkMacSystemFont, sans-serif;
            background: linear-gradient(135deg, #1E3A5F 0%, #0f2744 100%);
            min-height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 20px;
        }
        
        .login-container {
            background: white;
            border-radius: 16px;
            box-shadow: 0 25px 50px -12px rgba(0, 0, 0, 0.4);
            padding: 48px 40px;
            width: 100%;
            max-width: 420px;
            text-align: center;
        }
        
        .logo-area {
            margin-bottom: 32px;
        }
        
        .logo-area svg {
            width: 80px;
            height: 80px;
            color: #1E3A5F;
        }
        
        .logo-area h1 {
            color: #1E3A5F;
            font-size: 24px;
            font-weight: 700;
            margin-top: 16px;
            letter-spacing: -0.5px;
        }
        
        .logo-area p {
            color: #64748b;
            font-size: 14px;
            margin-top: 8px;
        }
        
        .input-group {
            margin-bottom: 24px;
            text-align: left;
        }
        
        .input-group label {
            display: block;
            color: #374151;
            font-size: 14px;
            font-weight: 600;
            margin-bottom: 8px;
        }
        
        .input-wrapper {
            position: relative;
        }
        
        .input-wrapper input {
            width: 100%;
            padding: 14px 48px 14px 16px;
            border: 2px solid #e2e8f0;
            border-radius: 10px;
            font-size: 16px;
            transition: all 0.2s ease;
            outline: none;
        }
        
        .input-wrapper input:focus {
            border-color: #00B0F0;
            box-shadow: 0 0 0 3px rgba(0, 176, 240, 0.1);
        }
        
        .toggle-password {
            position: absolute;
            right: 14px;
            top: 50%;
            transform: translateY(-50%);
            background: none;
            border: none;
            cursor: pointer;
            color: #94a3b8;
            padding: 4px;
        }
        
        .toggle-password:hover {
            color: #64748b;
        }
        
        .btn-entrar {
            width: 100%;
            padding: 14px 24px;
            background: linear-gradient(135deg, #00B0F0 0%, #0088cc 100%);
            color: white;
            border: none;
            border-radius: 10px;
            font-size: 16px;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.2s ease;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 8px;
        }
        
        .btn-entrar:hover {
            transform: translateY(-2px);
            box-shadow: 0 10px 20px rgba(0, 176, 240, 0.3);
        }
        
        .btn-entrar:active {
            transform: translateY(0);
        }
        
        .btn-entrar:disabled {
            background: #94a3b8;
            cursor: not-allowed;
            transform: none;
            box-shadow: none;
        }
        
        .btn-entrar .spinner {
            width: 20px;
            height: 20px;
            border: 2px solid rgba(255,255,255,0.3);
            border-top-color: white;
            border-radius: 50%;
            animation: spin 0.8s linear infinite;
            display: none;
        }
        
        .btn-entrar.loading .spinner {
            display: block;
        }
        
        .btn-entrar.loading .btn-text {
            display: none;
        }
        
        @keyframes spin {
            to { transform: rotate(360deg); }
        }
        
        .erro-msg {
            background: #fef2f2;
            border: 1px solid #fecaca;
            color: #dc2626;
            padding: 12px 16px;
            border-radius: 8px;
            font-size: 14px;
            margin-bottom: 20px;
            display: none;
            align-items: center;
            gap: 8px;
        }
        
        .erro-msg.show {
            display: flex;
        }
        
        .seguranca-info {
            margin-top: 32px;
            padding-top: 24px;
            border-top: 1px solid #e2e8f0;
        }
        
        .seguranca-info p {
            color: #94a3b8;
            font-size: 12px;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 6px;
        }
        
        .seguranca-info svg {
            width: 14px;
            height: 14px;
        }
    </style>
</head>
<body>
    <div class="login-container">
        <div class="logo-area">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="1.5" d="M9 12.75L11.25 15 15 9.75m-3-7.036A11.959 11.959 0 013.598 6 11.99 11.99 0 003 9.749c0 5.592 3.824 10.29 9 11.623 5.176-1.332 9-6.03 9-11.622 0-1.31-.21-2.571-.598-3.751h-.152c-3.196 0-6.1-1.248-8.25-3.285z" />

                <circle cx="12" cy="12" r="10"></circle>

                <div class="input-wrapper">

                        <svg id="icon-eye-off" xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" style="display:none;">
                            <path d="M17.94 17.94A10.07 10.07 0 0 1 12 20c-7 0-11-8-11-8a18.45 18.45 0 0 1 5.06-5.94M9.9 4.24A9.12 9.12 0 0 1 12 4c7 0 11 8 11 8a18.5 18.5 0 0 1-2.16 3.19m-6.72-1.07a3 3 0 1 1-4.24-4.24"></path>
                            <line x1="1" y1="1" x2="23" y2="23"></line>
                        </svg>
                    </button>
                </div>
            </div>
            
            <button type="submit" class="btn-entrar" id="btn-entrar">
                <span class="btn-text">Acessar Dashboard</span>
                <div class="spinner"></div>
            </button>
        </form>
        
        <div class="seguranca-info">
            <p>
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                    <rect x="3" y="11" width="18" height="11" rx="2" ry="2"></rect>
                    <path d="M7 11V7a5 5 0 0 1 10 0v4"></path>
                </svg>
                Protegido com criptografia AES-256-GCM
            </p>
        </div>
    </div>

        const ITERACOES = 600000;
        const CHAVE_SESSAO = "dashboard_autenticado";
        
        function toggleSenha() {
            const input = document.getElementById('senha');
            const iconEye = document.getElementById('icon-eye');
            const iconEyeOff = document.getElementById('icon-eye-off');
            
            if (input.type === 'password') {
                input.type = 'text';
                iconEye.style.display = 'none';
                iconEyeOff.style.display = 'block';
            } else {
                input.type = 'password';
                iconEye.style.display = 'block';
                iconEyeOff.style.display = 'none';
            }
        }
        
        function mostrarErro(msg) {
            const erro = document.getElementById('erro');
            const erroTexto = document.getElementById('erro-texto');
            erroTexto.textContent = msg;
            erro.classList.add('show');
        }
        
        function esconderErro() {
            document.getElementById('erro').classList.remove('show');
        }
        
        function setLoading(loading) {
            const btn = document.getElementById('btn-entrar');
            const input = document.getElementById('senha');
            
            if (loading) {
                btn.classList.add('loading');
                btn.disabled = true;
                input.disabled = true;
            } else {
                btn.classList.remove('loading');
                btn.disabled = false;
                input.disabled = false;
            }
        }
        
        // Converte base64 para Uint8Array
        function b64ToUint8Array(b64) {
            const binaryString = atob(b64);
            const bytes = new Uint8Array(binaryString.length);
            for (let i = 0; i < binaryString.length; i++) {
                bytes[i] = binaryString.charCodeAt(i);
            }
            return bytes;
        }
        
        // Converte Uint8Array para hex string
        function uint8ArrayToHex(arr) {
            return Array.from(arr).map(b => b.toString(16).padStart(2, '0')).join('');
        }
        
        // Verifica senha usando PBKDF2
        async function verificarSenha(senha) {
            try {
                const enc = new TextEncoder();
                const senhaBytes = enc.encode(senha);
                const saltBytes = b64ToUint8Array(SALT_B64);
                
                const chaveBase = await crypto.subtle.importKey(
                    'raw',
                    senhaBytes,
                    { name: 'PBKDF2' },
                    false,
                    ['deriveBits']
                );
                
                const derivedBits = await crypto.subtle.deriveBits(
                    {
                        name: 'PBKDF2',
                        salt: saltBytes,
                        iterations: ITERACOES,
                        hash: 'SHA-256'
                    },
                    chaveBase,
                    256
                );
                
                const hashCalculado = uint8ArrayToHex(new Uint8Array(derivedBits));
                return hashCalculado === HASH_ESPERADO;
            } catch (e) {
                console.error('Erro ao verificar senha:', e);
                return false;
            }
        }
        
        // Salva token de sessão
        function salvarSessao() {
            try {
                const token = HASH_ESPERADO.substring(0, 32) + '_' + Date.now();
                sessionStorage.setItem(CHAVE_SESSAO, token);
            } catch (e) {
                console.warn('Não foi possível salvar sessão:', e);
            }
        }
        
        // Verifica se já existe uma sessão válida
        function verificarSessao() {
            try {
                const token = sessionStorage.getItem(CHAVE_SESSAO);
                if (token && token.startsWith(HASH_ESPERADO.substring(0, 32))) {
                    return true;
                }
            } catch (e) {
                console.warn('Não foi possível verificar sessão:', e);
            }
            return false;
        }
        
        // Decodifica o conteúdo HTML
        function obterConteudoHTML() {
            const conteudoBytes = b64ToUint8Array(CONTEUDO_B64);
            const decoder = new TextDecoder('utf-8');
            return decoder.decode(conteudoBytes);
        }
        
        // Exibe o conteúdo usando iframe fullscreen (mais confiável)
        function exibirConteudo() {
            try {
                const html = obterConteudoHTML();
                
                // Cria iframe fullscreen
                const iframe = document.createElement('iframe');
                iframe.id = 'dashboard-frame';
                iframe.style.cssText = 'position:fixed;top:0;left:0;width:100%;height:100%;border:none;margin:0;padding:0;z-index:999999;background:#fff;';
                
                // Esconde o conteúdo original
                document.body.style.overflow = 'hidden';
                document.body.innerHTML = '';
                document.body.appendChild(iframe);
                
                // Escreve o conteúdo no iframe
                const iframeDoc = iframe.contentWindow.document;
                iframeDoc.open();
                iframeDoc.write(html);
                iframeDoc.close();
                
            } catch (e) {
                console.error('Erro ao exibir conteúdo:', e);
                mostrarErro('Erro ao carregar o dashboard.');
            }
        }
        
        async function tentarAcesso(event) {
            event.preventDefault();
            esconderErro();
            
            const senha = document.getElementById('senha').value;
            
            if (!senha) {
                mostrarErro('Por favor, digite a senha.');
                return;
            }
            
            setLoading(true);
            
            await new Promise(r => setTimeout(r, 50));
            
            try {
                const senhaCorreta = await verificarSenha(senha);
                
                if (senhaCorreta) {
                    salvarSessao();
                    exibirConteudo();
                } else {
                    setLoading(false);
                    mostrarErro('Senha incorreta. Tente novamente.');
                    document.getElementById('senha').value = '';
                    document.getElementById('senha').focus();
                }
            } catch (e) {
                setLoading(false);
                mostrarErro('Erro ao processar. Tente novamente.');
                console.error(e);
            }
        }
        
        // Inicialização
        document.addEventListener('DOMContentLoaded', function() {
            // Verifica se já tem sessão válida
            if (verificarSessao()) {
                exibirConteudo();
                return;
            }
            
            // Se não tem sessão, configura o formulário
            document.getElementById('senha').focus();
            document.getElementById('form-login').addEventListener('submit', tentarAcesso);
        });
    </script>
